        const db = firebase.database();
        console.log(db)
    }
    render() {
      return (
          <div>
              <div className="login_block">
                  <input type="text" placeholder="e-mail" />
                  <input type="password" placeholder="password" />
                  <input type="submit" />
              </div>
          </div>
        )
    }
};
